import React from 'react';

const Home = () => (
  <div>
    <h1>Home</h1>
    Navigate to the Account page to customize your profile or <a href="http://localhost:3000/admin">Chatroom</a> to start watching and chatting with friends.
  </div>
);

export default Home;
